import React, { Component } from "react";
import "./App.css";
import "antd/dist/antd.css";
import CustomLayout from "./containers/Layout";
import MealList from "./containers/MealList";

class App extends Component {
  render() {
    return (
      <div className="App">
        <CustomLayout>
          <MealList />
        </CustomLayout>
      </div>
    );
  }
}
export default App;
